import React from 'react';
import logo from './logo.svg';
import './App.css';
import { Container } from 'semantic-ui-react';
import Login from "./Login";

function App() {
  return (
    <Fragment>
      <Container>
        <Login />
      </Container>
    </Fragment>
  );
}

export default App;
